                image={video.image} 
                title={video.title} 
                channel={video.channel}
                // onClick={(id) => {
                //   props.setNowPlayingVideo(props.video.id);
                // }}
                setNowPlayingVideo={props.setNowPlayingVideo}
                />


                ))}
              </div>        
        {/* </section> */}
      </ul>
    )
}

export default VideoList
